def split(fname, train_ratio, var_ratio):
    lines = fname.readlines()
    n_total = len(lines)  # 获取数据集的总长度

    train_offset = int(n_total * train_ratio)
    val_offset = int(n_total * (train_ratio + var_ratio))
    random.shuffle(fname.read())  # 按行打乱顺序

    train_data = open('train.csv', 'wb')
    val_data = open('dev.csv', 'wb')
    test_data = open('test.csv', 'wb')

    for i, line in enumerate(lines):
        if i < train_offset:
            train_data.write(line)
        elif i < val_offset:
            val_data.write(line)
        else:
            test_data.write(line)

    train_data.close()
    val_data.close()
    test_data.close()


def process_data(fname):
    namef = open('{}.csv'.format(fname), "rb")
    lines = namef.readlines()
    namef.close()

    emo_list = []
    dialogs = []
    for i, data in enumerate(lines):
        utt = ' '.join(data.decode().strip().split(',')[1:-1])
        context = utt.strip().split(' __eou__ ')
        emo = data.decode().strip().split(',')[-1]
        # emos = emo + '0'
        # emo_list.append(emos)
        emo_list.append(emo)
        dialogs.append(context)

    emo_dict = {
        '1': 'Happiness',
        '2': 'Love',
        '3': 'Sorrow',
        '4': 'Fear',
        '5': 'Disgust',
        '6': 'None'
    }

    with open('dataset/newdata/newdata_{}.txt'.format(fname), 'w', encoding="utf-8") as f:
        for i in range(1, len(lines) - 1):
            for j in range(len(dialogs[i])):
                print(j % 2, '\t', dialogs[i][j], '\t', emo_dict[emo_list[i][j]], file=f)
            print(file=f)


